  {
    id: 3,
    rating: 8,
    text: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. consequuntur vel vitae commodi alias voluptatem est voluptatum ipsa quae.',
  },
]

const App = () => {

  return (
    <div className="App">
       <Header />
       <FeedbackList items = {FeedbackData} />
    </div>
  );
}

export default App;
